                            high,week52Low,week52High,change,changePercent,ytdChange) {
           return { symbol,latestPrice,marketCap,avgTotalVolume,peRatio,open,close,low,
                            high,week52Low,week52High,change,changePercent,ytdChange };
  }

function buildRows(data) {
  return data.map((quote, index)=>{
    createData(
      quote.symbol,
      quote.latestPrice,

    )
  })
}

const rows = [
  createData('AAPL', 111, 111111, 111, 111,111,111,111,111,111,111,111,111,111),
  createData('TSLA', 222,222222,222,222,222,222,222,222,222,222,222,222,222),
  createData('F',    333,333333,333,333,333,333,333,333,333,333,333,333,333)
];

function desc(a, b, orderBy) {
  if (b[orderBy] < a[orderBy]) {
    return -1;
  }
  if (b[orderBy] > a[orderBy]) {
    return 1;
  }
  return 0;
}

function stableSort(array, cmp) {
  const stabilizedThis = array.map((el, index) => [el, index]);
  stabilizedThis.sort((a, b) => {
    const order = cmp(a[0], b[0]);
    if (order !== 0) return order;
    return a[1] - b[1];
  });
  return stabilizedThis.map(el => el[0]);
}

function getSorting(order, orderBy) {
  return order === 'desc' ? (a, b) => desc(a, b, orderBy) : (a, b) => -desc(a, b, orderBy);
}

